import React from 'react';
import PropTypes from 'prop-types';
import Dialog from '@material-ui/core/Dialog';
import Button from '@material-ui/core/Button';
import ScrollAnim from 'rc-scroll-anim';
import content from './SectionsContent';
import iniciaScroll from './Scroll';
const ScrollOverPack = ScrollAnim.OverPack;


const find = id => content.find(p => p.id === id);


const styles = {
    appBar: {
      position: 'relative',
    },
    flex: {
      flex: 1,
    },
  };
function DialogTransition(props) {
    return <Slide direction="down" {...props}/>;
}


const OverPack = ({data}) => {
    let n = find(data.params.id);

    return (
        <ScrollOverPack
            always={true}
            appear={true}
                componentProps={{ tweenOne2:  {reverse :true }, tweenOne:  {reverse :true } }}
            className={n.classe}
            id={n.hash}
            playScale={0.5}>
            <Botao
                data={{
                params: {
                    n: n.id
                }
            }}/>
            {Twn({n: n})}
            {Transition({n: n})}
        </ScrollOverPack>
    )
}
class Home extends React.Component {
    componentDidMount() {
        iniciaScroll();
    }
    render() {

        return (
            content.map((i) => (<OverPack
            data={{
            params: {
                id: i.id
            }
        }}></OverPack>)));
    }
}

export default Home;
